import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Slider from '@material-ui/core/Slider';
import Select from '@material-ui/core/Select';

class PaletteNavbar extends Component {
    constructor(props){
        super(props);
    
        this.handleChange = this.handleChange.bind(this)
        

    }
    // const [anchorEl, setAnchorEl] = React.useState(null);
    handleClick(event) {
        setAnchorEl(event.currentTarget);
    }
    
      handleClose() {
        setAnchorEl(null);
    }
    render(){
        
        return(
            <div className="PaletteNavbar">
                
         <Select onChange={handleChange}>
            <MenuItem value = 'hex'>Profile</MenuItem>
            <MenuItem value='rgb'>My account</MenuItem>
            <MenuItem value='rgba'>Logout</MenuItem>
         </Select>
                

            </div>
        )
    }
}

export default PaletteNavbar;
